import React, { useEffect } from 'react'
import { Routes, Route, useNavigate, useLocation } from 'react-router-dom'
import './Section.css'
import WeatherNow from './Weather_Now/WeatherNow'
import WeatherForecast from './Weather_Forecast/WeatherForecast'
import Error404 from './Error404/Error404'
import EightDays from './Weather_Forecast/ContentWeatherForecast/Days/EightDays'
import TwelveDays from './Weather_Forecast/ContentWeatherForecast/Days/TwelveDays'
import SixteenDays from './Weather_Forecast/ContentWeatherForecast/Days/SixteenDays'


export default function Section() {

  const navigate = useNavigate()
  const location = useLocation()

  useEffect(() => {
    if(location.path === 'weather-forecast'){
      navigate('/weather-forecast/8days')
    }
  },[])

    return (
      <section>
        <div className="section-content">
          <Routes>
            <Route path='/' element={<WeatherNow />} />
            <Route path='/weather-forecast' element={<WeatherForecast />}>
              <Route path='8days' element={<EightDays />} />
              <Route path='12days' element={<TwelveDays />} />
              <Route path='16days' element={<SixteenDays />} />
            </Route>
            <Route path='*' element={<Error404 />} />
          </Routes>
        </div>
      </section>
    )
}
